import * as React from 'react';
import { View } from 'react-native';

import { Form, FormItem } from 'library';

export default function App() {
  return (
    <View style={{ flex: 1, backgroundColor: 'brown' }}>
      <Form>
        <FormItem />
      </Form>
    </View>
  );
}
